import React from 'react';
import venusmenu from './MenuStyle/'
import venusani from './Venus_animation.module.scss';

const Venus = ({checked}) => {
    return (
        <>
            <div id= {checked ? venusani.venus_animode : venusmenu.venus_menumode}></div>
        </>
    );
};

export default Venus;
